import Chart from "react-apexcharts";

const Dashboard = () => {
    const chartData = {
        options: {
            chart: { id: "margin-chart", toolbar: { show: false } },
            xaxis: { categories: ["12th Oct", "13th Oct", "14th Oct", "15th Oct", "16th Oct", "17th Oct"] },
            colors: ["#ADFF2F"],
            stroke: { curve: "smooth", width: 3 },
            tooltip: { enabled: true }
        },
        series: [{ name: "Margin %", data: [30, 40, 80, 50, 90, 60] }]
    };

    return (
        <div style={{ minHeight: "100vh", background: "linear-gradient(135deg, #3a7bd5, #00d2ff)", padding: "20px", position: "relative" }}>

            <div style={{ display: "flex", gap: "20px", margin: "20px", justifyContent: "flex-start" }}>
                <div style={{ background: "#203647", borderRadius: "16px", width: "180px", height: "120px", color: "#fff", padding: "16px", boxShadow: "0 6px 12px rgba(0,0,0,0.5)" }}>
                    <div style={{ fontSize: "18px", marginBottom: "8px" }}>Inventory</div>
                    <div style={{ fontSize: "28px", fontWeight: "bold" }}>93%</div>
                </div>
                <div style={{ background: "#203647", borderRadius: "16px", width: "180px", height: "120px", color: "#fff", padding: "16px", boxShadow: "0 6px 12px rgba(0,0,0,0.5)" }}>
                    <div style={{ fontSize: "18px", marginBottom: "8px" }}>Orders</div>
                    <div style={{ fontSize: "28px", fontWeight: "bold" }}>65%</div>
                </div>
                <div style={{ background: "#203647", borderRadius: "16px", width: "180px", height: "120px", color: "#fff", padding: "16px", boxShadow: "0 6px 12px rgba(0,0,0,0.5)" }}>
                    <div style={{ fontSize: "18px", marginBottom: "8px" }}>Battery</div>
                    <div style={{ fontSize: "28px", fontWeight: "bold" }}>65%</div>
                </div>
            </div>

            <div style={{ margin: "20px", borderRadius: "16px", background: "#203647", padding: "20px", boxShadow: "0 6px 12px rgba(0,0,0,0.5)" }}>
                <div style={{ color: "#fff", marginBottom: "16px", fontSize: "20px", fontWeight: "bold" }}>Margin %</div>
                <Chart options={chartData.options} series={chartData.series} type="line" height={300} />
            </div>

            <div style={{ position: "absolute", bottom: "10px", width: "100%", textAlign: "center", color: "#fff", fontSize: "14px" }}>
                Â© 2025, Greendzine Technologies Pvt. Ltd. All Rights Reserved.
            </div>
        </div>
    );
};

export default Dashboard;
